oFF.OlapUiValueHelpNodeComparator.prototype._ff_c = "OlapUiValueHelpNodeComparator";

oFF.OlapUiValueHelpNodeComparator.create = function(isHierarchy)
{
	var obj = new oFF.OlapUiValueHelpNodeComparator();
	obj.m_isHierarchy = isHierarchy;
	return obj;
};
oFF.OlapUiValueHelpNodeComparator.prototype.m_isHierarchy = false;
oFF.OlapUiValueHelpNodeComparator.prototype.compare = function(o1, o2)
{
	var fieldValue1 = this.getKeyFieldValue(o1).getValue();
	var fieldValue2 = this.getKeyFieldValue(o2).getValue();
	if (fieldValue1.getValueType().isNumber())
	{
		var comparison = oFF.XConverterUtils.getDouble(fieldValue1) - oFF.XConverterUtils.getDouble(fieldValue2);
		return comparison < 0 ? -1 : comparison > 0 ? 1 : 0;
	}
	return oFF.XString.compare(fieldValue1.getStringRepresentation(), fieldValue2.getStringRepresentation());
};
oFF.OlapUiValueHelpNodeComparator.prototype.getKeyFieldValue = function(node)
{
	var keyField = this.m_isHierarchy ? node.getDimension().getHierarchyKeyField() : node.getDimension().getFlatKeyField();
	return node.getDimensionMember().getFieldValue(keyField);
};

oFF.OlapUiMessageCenter = function() {};
oFF.OlapUiMessageCenter.prototype = new oFF.XObject();
oFF.OlapUiMessageCenter.prototype._ff_c = "OlapUiMessageCenter";

oFF.OlapUiMessageCenter.create = function(uiCreateOperations)
{
	var obj = new oFF.OlapUiMessageCenter();
	obj.m_uiCreateOperations = uiCreateOperations;
	return obj;
};
oFF.OlapUiMessageCenter.prototype.m_uiCreateOperations = null;
oFF.OlapUiMessageCenter.prototype.m_externalMessageCenter = null;
oFF.OlapUiMessageCenter.prototype.setExternalMessageCenter = function(externalMessageCenter)
{
	this.m_externalMessageCenter = externalMessageCenter;
};
oFF.OlapUiMessageCenter.prototype.postMesssage = function(type, message, component)
{
	if (oFF.notNull(this.m_externalMessageCenter))
	{
		var sacType = this.translateToSacType(type);
		this.m_externalMessageCenter.postMsg(sacType, "", message, component);
	}
	else
	{
		var toast = this.m_uiCreateOperations.newControl(oFF.UiType.TOAST);
		toast.setText(message);
		toast.setMessageType(type);
		toast.open();
	}
};
oFF.OlapUiMessageCenter.prototype.translateToSacType = function(type)
{
	if (type === oFF.UiMessageType.ERROR)
	{
		return 1;
	}
	if (type === oFF.UiMessageType.WARNING)
	{
		return 2;
	}
	if (type === oFF.UiMessageType.INFORMATION)
	{
		return 3;
	}
	if (type === oFF.UiMessageType.SUCCESS)
	{
		return 4;
	}
	return 3;
};
oFF.OlapUiMessageCenter.prototype.getInaErrorMessage = function(messages, defaultMessage)
{
	if (oFF.notNull(messages) && messages.getServerStatusCode() === oFF.HttpStatusCode.SC_OK)
	{
		var firstError = messages.getFirstError();
		if (oFF.notNull(firstError) && oFF.XStringUtils.isNotNullAndNotEmpty(firstError.getText()))
		{
			return firstError.getText();
		}
	}
	return defaultMessage;
};
oFF.OlapUiMessageCenter.prototype.getInaErrorCode = function(messages)
{
	if (oFF.notNull(messages))
	{
		var firstError = messages.getFirstError();
		if (oFF.notNull(firstError))
		{
			return firstError.getCode();
		}
	}
	return 0;
};
oFF.OlapUiMessageCenter.prototype.releaseObject = function()
{
	this.m_externalMessageCenter = null;
	this.m_uiCreateOperations = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.OlapUiMessageCenter.prototype.cloneExt = function(flags)
{
	var objClone = new oFF.OlapUiMessageCenter();
	objClone.m_uiCreateOperations = this.m_uiCreateOperations;
	objClone.setExternalMessageCenter(this.m_externalMessageCenter);
	return objClone;
};

