oFF.VdOnBusyEndHandler.prototype.onBusyEnd = function(hasErrors)
{
	if (!hasErrors)
	{
		switch (this.m_mode)
		{
			case oFF.VdOnBusyEndHandler.MODE_VH_DIALOG:
				this.m_controller.performValueHelpWithDialog(this.m_variableModel, this.m_currentSelection, this.m_selectionMode, this.m_closeListener);
				break;

			case oFF.VdOnBusyEndHandler.MODE_VH_SEARCH:
				this.m_controller.performValueSearch(this.m_variableModel, this.m_input, this.m_valueHelpListener, this.m_customIdentifier);
				break;

			default:
				throw oFF.XException.createIllegalArgumentException(oFF.XStringUtils.concatenate2("unknown mode", this.m_mode));
		}
	}
	oFF.XObjectExt.release(this);
};

