{
	return oFF.notNull(this.m_externalFormatter) ? this.m_externalFormatter.format(value) : value;
};
oFF.OlapUiNumberFormatter.prototype.parseFormattedNumber = function(value)
{
	if (oFF.notNull(this.m_externalFormatter))
	{
		return this.m_externalFormatter.parseFormattedNumber(value);
	}
	if (oFF.XString.containsString(value, "NaN"))
	{
		return null;
	}
	try
	{
		if (oFF.XStringUtils.isNotNullAndNotEmpty(value))
		{
			var dValue = oFF.XDouble.convertFromString(value);
			return oFF.XDouble.convertToString(dValue);
		}
	}
	catch (e)
	{
		return null;
	}
	return value;
};
oFF.OlapUiNumberFormatter.prototype.formatTextForDateTimeKey = function(textValue, keyValue, keyValueType)
{
	return oFF.notNull(this.m_externalFormatter) ? this.m_externalFormatter.formatTextForDateTimeKey(textValue, keyValue, keyValueType) : textValue;
};
