	var contentContainer = genesis.newControl(oFF.UiType.FLEX_LAYOUT);
	contentContainer.setDirection(oFF.UiFlexDirection.COLUMN);
	contentContainer.setWrap(oFF.UiFlexWrap.NO_WRAP);
