oFF.FdEntryPoint.prototype.onFilterDialogOk = function(selection)
{
	var oldFilter = null;
	var filter = this.m_dimension.getFilter();
	if (oFF.notNull(filter))
	{
		oldFilter = filter.serializeToString(oFF.QModelFormat.INA_DATA);
		filter.clear();
	}
	else
	{
		var dynamicFilter = this.m_dimension.getQueryModel().getFilter().getDynamicFilter();
		filter = dynamicFilter.getCartesianListWithDefault(this.m_dimension);
	}
	var keyField = this.m_dimension.getKeyField();
	var displayKeyField = this.m_dimension.getDisplayKeyField() !== keyField ? this.m_dimension.getDisplayKeyField() : null;
	var textField = this.m_dimension.getTextField();
	filter.addSupplementField(displayKeyField);
	filter.addSupplementField(textField);
	for (var i = 0; i < selection.size(); i++)
	{
		var selectedItem = selection.get(i);
		var filterElement = filter.addNewCartesianElement();
		filterElement.setComparisonOperator(oFF.ComparisonOperator.EQUAL);
		filterElement.setField(keyField);
		var low = filterElement.getLow();
		low.setValue(oFF.XValueUtil.getValueFromString(selectedItem.getKey(), keyField.getValueType()));
		this.addSupplement(low, displayKeyField, selectedItem.getDisplayKey());
		this.addSupplement(low, textField, selectedItem.getText());
	}
	var filterChanged = !oFF.XString.isEqual(oldFilter, filter.serializeToString(oFF.QModelFormat.INA_DATA));
	if (oFF.notNull(this.m_filterUpdatedListener))
	{
		this.m_filterUpdatedListener.onFilterUpdated(filterChanged);
		this.m_filterUpdatedListener = null;
	}
};
oFF.FdEntryPoint.prototype.addSupplement = function(valueBag, field, value)
{
	if (oFF.notNull(field) && oFF.notNull(value))
	{
		valueBag.addSupplementValue(field.getName(), value);
	}
};
oFF.FdEntryPoint.prototype.onFilterDialogCancel = function()
{
	if (oFF.notNull(this.m_filterUpdatedListener))
	{
		this.m_filterUpdatedListener.onFilterUpdated(false);
		this.m_filterUpdatedListener = null;
	}
};
