oFF.OlapUiValueHelpDimension.prototype.processValueHelp = function(startPage, endPage, pageSize, fields, requestMasterData, listener, customIdentifier)
{
	var dimension = this.m_valueRequestObject;
	this.configureValueHelp(dimension, this.getReadMode(requestMasterData), startPage, endPage, pageSize, fields);
	dimension.processValueHelp(oFF.OlapUiValueHelpAbstract.s_syncType, listener, customIdentifier);
};
oFF.OlapUiValueHelpDimension.prototype.processChildFetch = function(node, offset, amount, fields, requestMasterData, listener, customIdentifier)
{
	var dimension = node.getDimension();
	this.configureValueHelp(dimension, this.getReadMode(requestMasterData), 0, 0, amount, fields);
	dimension.setSelectorPaging(offset, offset + amount);
	node.processValueHelpChildFetch(oFF.OlapUiValueHelpAbstract.s_syncType, listener, customIdentifier);
};
oFF.OlapUiValueHelpDimension.prototype.processSearch = function(searchPattern, searchFields, fields, pageSize, loadParentNodes, requestMasterData, listener, customIdentifier)
{
	var dimension = this.m_valueRequestObject;
	this.configureValueHelp(dimension, this.getReadMode(requestMasterData), 0, 0, pageSize, fields);
	var filterAdded = oFF.XStringUtils.isNotNullAndNotEmpty(searchPattern) && this.setSelectorFilter(dimension, searchPattern, searchFields, loadParentNodes);
	if (!filterAdded)
	{
		listener.onValuehelpExecuted(oFF.ExtResult.create(oFF.XList.create(), null), null, customIdentifier);
		return;
	}
	dimension.processValueHelp(oFF.OlapUiValueHelpAbstract.s_syncType, listener, customIdentifier);
	dimension.clearSelectorFilter();
};
oFF.OlapUiValueHelpDimension.prototype.processFetchItems = function(items, fields, listener, customIdentifier)
{
	var dimension = this.m_valueRequestObject;
	this.configureFetchItems(dimension, this.getReadMode(true), items, fields);
	dimension.processValueHelp(oFF.OlapUiValueHelpAbstract.s_syncType, listener, customIdentifier);
	dimension.clearSelectorFilter();
};

