{
	var obj = new oFF.VdVariantManager();
	obj.setupExt(context);
	return obj;
};
oFF.VdVariantManager.prototype.m_context = null;
oFF.VdVariantManager.prototype.setupExt = function(context)
{
	this.m_context = context;
};
