oFF.HelloWorldDialog = function() {};
oFF.HelloWorldDialog.prototype = new oFF.XObject();
oFF.HelloWorldDialog.prototype._ff_c = "HelloWorldDialog";

oFF.HelloWorldDialog.createHelloWorldDialog = function()
{
	var obj = new oFF.HelloWorldDialog();
	obj.setupHelloWorldDialog();
	return obj;
};
oFF.HelloWorldDialog.prototype.m_application = null;
oFF.HelloWorldDialog.prototype.m_helloWorldDialog = null;
oFF.HelloWorldDialog.prototype.setupHelloWorldDialog = function()
{
	this.m_application = oFF.ApplicationFactory.createDefaultApplication();
	var uiManager = this.m_application.getUiManager();
	var freeGenesis = uiManager.getFreeGenesis();
	this.m_helloWorldDialog = freeGenesis.newControl(oFF.UiType.DIALOG);
	this.m_helloWorldDialog.setName("helloWorldDialog");
	this.m_helloWorldDialog.setTitle("Example dialog");
	var closeBtn = freeGenesis.newControl(oFF.UiType.DIALOG_BUTTON);
	closeBtn.setName("closeBtn");
	closeBtn.setText("Close");
	closeBtn.setIcon("decline");
	closeBtn.registerOnPress(this);
	this.m_helloWorldDialog.addDialogButton(closeBtn);
	var dialogLayout = freeGenesis.newControl(oFF.UiType.FLEX_LAYOUT);
	dialogLayout.setDirection(oFF.UiFlexDirection.COLUMN);
	dialogLayout.setJustifyContent(oFF.UiFlexJustifyContent.CENTER);
	dialogLayout.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	dialogLayout.useMaxSpace();
	this.m_helloWorldDialog.setContent(dialogLayout);
	var globeIcon = freeGenesis.newControl(oFF.UiType.ICON);
	globeIcon.setIcon("globe");
	globeIcon.setSize(oFF.UiSize.createByCss("40px", "40px"));
	globeIcon.setEnabled(false);
	var helloWorldLbl = freeGenesis.newControl(oFF.UiType.LABEL);
	helloWorldLbl.setText("Hello World! It seems that firefly Ui is working!");
	helloWorldLbl.setFontSize(oFF.UiCssLength.createExt(17, oFF.UiCssSizeUnit.PIXEL));
	helloWorldLbl.setFontColor(oFF.UiColor.BLUE);
	dialogLayout.addItem(globeIcon);
	dialogLayout.addNewItemOfType(oFF.UiType.SPACER).setHeight(oFF.UiCssLength.create("10px"));
	dialogLayout.addItem(helloWorldLbl);
};
oFF.HelloWorldDialog.prototype.releaseObject = function()
{
	this.m_helloWorldDialog = oFF.XObjectExt.release(this.m_helloWorldDialog);
	this.m_application = oFF.XObjectExt.release(this.m_application);
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.HelloWorldDialog.prototype.openDialog = function()
{
	if (oFF.notNull(this.m_helloWorldDialog))
	{
		this.m_helloWorldDialog.open();
	}
};
oFF.HelloWorldDialog.prototype.onPress = function(event)
{
	this.m_helloWorldDialog.close();
};

