oFF.FdController.prototype.m_display = null;
oFF.FdController.prototype.m_valueHelpExecutor = null;
oFF.FdController.prototype.m_model = null;
oFF.FdController.prototype.m_configuration = null;
oFF.FdController.prototype.m_valueType = null;
oFF.FdController.prototype.m_closeListener = null;
oFF.FdController.prototype.m_selectionChangeListener = null;
oFF.FdController.prototype.m_view = null;
oFF.FdController.prototype.m_isClosed = false;
oFF.FdController.prototype.m_okButton = null;
oFF.FdController.prototype.m_cancelButton = null;
oFF.FdController.prototype.m_sideTab = null;
oFF.FdController.prototype.m_functionControllers = null;
oFF.FdController.prototype.releaseObject = function()
{
	this.m_configuration = oFF.XObjectExt.release(this.m_configuration);
	this.m_okButton = oFF.XObjectExt.release(this.m_okButton);
	this.m_cancelButton = oFF.XObjectExt.release(this.m_cancelButton);
	this.m_display = oFF.XObjectExt.release(this.m_display);
	this.m_context = null;
	this.releaseOnClose();
};
oFF.FdController.prototype.releaseOnClose = function()
{
	this.m_view = oFF.XObjectExt.release(this.m_view);
	this.m_model = oFF.XObjectExt.release(this.m_model);
	this.m_valueHelpExecutor = oFF.XObjectExt.release(this.m_valueHelpExecutor);
	this.m_configuration = null;
	this.m_closeListener = null;
	this.m_selectionChangeListener = null;
	this.m_valueType = null;
	this.m_sideTab = oFF.XObjectExt.release(this.m_sideTab);
	this.m_functionControllers = oFF.XCollectionUtils.releaseEntriesAndCollectionIfNotNull(this.m_functionControllers);
};
oFF.FdController.prototype.openFilterDialogForVariable = function(variable, configuration, listener)
{
	oFF.XObjectExt.assertNotNullExt(variable, "Variable must be set");
	oFF.XObjectExt.assertNotNullExt(configuration, "Configuration must be set");
	this.m_valueType = oFF.FdValueType.VARIABLE_VALUE_HELP;
	this.openDialog(variable, configuration, listener);
};
oFF.FdController.prototype.openFilterDialogForDimension = function(dimension, configuration, listener)
{
	oFF.XObjectExt.assertNotNullExt(dimension, "Dimension must be set");
	oFF.XObjectExt.assertNotNullExt(configuration, "Configuration must be set");
	this.m_valueType = oFF.FdValueType.DIMENSION_MEMBER_VALUE_HELP;
	this.openDialog(dimension, configuration, listener);
};
oFF.FdController.prototype.openDialog = function(valueRequestObject, configuration, listener)
{
	this.m_configuration = configuration;
	this.m_closeListener = listener;
	this.m_isClosed = false;
	this.m_functionControllers = oFF.XLinkedHashMapByString.create();
	var display = this.m_context.getDisplayFactory().getInstance();
	if (oFF.isNull(display) || display !== this.m_display)
	{
		this.m_display = display;
		this.m_display.setName("FilterDialog");
		this.m_display.setCssClass("ffFilterDialog");
		this.m_display.registerOnAfterOpen(this);
		this.m_display.registerOnBeforeClose(this);
		this.m_okButton = oFF.XObjectExt.release(this.m_okButton);
		this.m_okButton = this.m_display.addNewButton();
		this.m_okButton.setName(oFF.FdController.OK_BUTTON);
		this.m_okButton.setText(this.m_context.getLocalization().getText(oFF.FilterDialogI18n.I18N_FD_OK));
		this.m_okButton.setButtonType(oFF.UiButtonType.PRIMARY);
		this.m_okButton.setVisible(false);
		this.m_cancelButton = oFF.XObjectExt.release(this.m_cancelButton);
		this.m_cancelButton = this.m_display.addNewButton();
		this.m_cancelButton.setName(oFF.FdController.CANCEL_BUTTON);
		this.m_cancelButton.setText(this.m_context.getLocalization().getText(oFF.FilterDialogI18n.I18N_FD_CANCEL));
		this.m_cancelButton.registerOnPress(this);
	}
	this.m_display.setTitle(configuration.getTitle());
	if (configuration.getWidth() > 0 && configuration.getWidthUnit() !== null)
	{
		this.m_display.setWidth(oFF.UiCssLength.createExt(configuration.getWidth(), configuration.getWidthUnit()));
	}
	if (configuration.getHeight() > 0 && configuration.getHeightUnit() !== null)
	{
		this.m_display.setHeight(oFF.UiCssLength.createExt(configuration.getHeight(), configuration.getHeightUnit()));
	}
	this.m_valueHelpExecutor = oFF.FdValueHelpExecutor.create(valueRequestObject, this.m_valueType, this.m_configuration, this.m_context.getFeatureToggle().isActive(oFF.OlapUiFeatureToggle.MEMBERSELECTOR_READMODE_SWITCH));
	var readModeSwitchVisible = this.m_valueHelpExecutor.supportsReadModeSwitch();
	var mainPresentations = oFF.FdPresentationUtils.getMainPresentationByDim(this.m_valueHelpExecutor.getDimension(), this.m_context.getLocalization(), this.m_valueHelpExecutor.isHierarchicalValueHelp());
	var additionalPresentations = this.getAdditionalPresentations();
	var sessionData = this.getSessionData();
	var displayInfoInSession = sessionData.getMainPresentationDisplayInfo();
	var displayInfo = oFF.notNull(displayInfoInSession) ? displayInfoInSession : this.m_configuration.getDimensionDisplayInfo();
	this.m_model = oFF.FdModel.create(this.m_configuration.getPageSize(), this.m_configuration.getChildNodesPageSize());
	this.m_model.setMainPresentations(mainPresentations);
	this.m_model.setAdditionalPresentations(additionalPresentations);
	this.m_model.setDefaultMainPresentation(oFF.FdPresentationUtils.mapDisplayInfoToPresentation(displayInfo, this.m_valueHelpExecutor.getDimension(), mainPresentations));
	this.m_model.setDefaultAdditionalPresentations(sessionData.getAdditionalPresentations(additionalPresentations));
	this.m_model.setReadModeSwitchVisible(readModeSwitchVisible);
	this.m_model.setReadModeSwitchEnabled(readModeSwitchVisible && this.m_valueHelpExecutor.supportsMasterAndBookedReadModes());
	this.m_model.setReadModeSwitchOn(this.m_valueHelpExecutor.isRequestMasterData());
	this.m_model.setAlwaysShowSelectionContainer(this.m_configuration.isAlwaysShowSelectionContainer());
	var selection = this.m_configuration.getSelection();
	if (!oFF.XCollectionUtils.hasElements(selection) && this.m_configuration.isDetermineSelectionFromContext())
	{
		if (this.m_valueType === oFF.FdValueType.DIMENSION_MEMBER_VALUE_HELP)
		{
			selection = this.m_configuration.getItemFactory().createSelectionFromDynamicFilter(valueRequestObject);
		}
		else if (this.m_valueType === oFF.FdValueType.VARIABLE_VALUE_HELP)
		{
			selection = this.m_configuration.getItemFactory().createSelectionFromVariable(valueRequestObject);
		}
	}
	this.m_model.changeSelection(selection, null);
	this.m_display.getGenesis().newRoot(oFF.UiType.ACTIVITY_INDICATOR).useMaxSpace();
	this.m_display.open();
};
oFF.FdController.prototype.onAfterOpen = function(event)
{
	if (this.m_configuration.isFunctionalValuesEnabled() && this.m_valueHelpExecutor.supportsFunctionalValueHelp())
	{
		this.fetchValueHelpFunctions();
	}
	else
	{
		this.fetchValueHelpData();
	}
};
oFF.FdController.prototype.isOpen = function()
{
	return oFF.notNull(this.m_display) && this.m_display.isOpen();
};
oFF.FdController.prototype.cancelSelection = function()
{
	this.closeDialog(true, null);
};
oFF.FdController.prototype.confirmSelection = function()
{
	this.closeDialog(false, this.m_model.getSelectedItems());
};
oFF.FdController.prototype.onBeforeClose = function(event)
{
	this.cancelSelection();
};
oFF.FdController.prototype.closeDialog = function(isCancel, selection)
{
	if (!this.m_isClosed)
	{
		this.m_isClosed = true;
		if (oFF.notNull(this.m_closeListener))
		{
			if (isCancel)
			{
				this.m_closeListener.onFilterDialogCancel();
			}
			else
			{
				this.m_closeListener.onFilterDialogOk(selection);
			}
		}
		if (oFF.notNull(this.m_display) && this.m_display.isOpen())
		{
			this.m_display.close();
		}
		this.releaseOnClose();
	}
};
oFF.FdController.prototype.onProcessFinished = function(items, startPage, customIdentifier)
{
	var processType = customIdentifier.toString();
	if (oFF.notNull(this.m_display) && oFF.notNull(items) && !this.m_isClosed)
	{
		switch (processType)
		{
			case oFF.FdController.IDENTIFIER_INITIAL_LOAD_FUNCTIONS:
				for (var i = 0; i < items.size(); i++)
				{
					var item = items.get(i);
					this.m_functionControllers.put(item.getName(), oFF.FdVhFunctionController.create(this.m_context, this, item.getFunction()));
				}
				this.fetchValueHelpData();
				break;

			case oFF.FdController.IDENTIFIER_INITIAL_LOAD:
				this.onInitialLoadFinished(items);
				break;

			case oFF.FdController.IDENTIFIER_REFRESH:
				this.m_view.publishMembersList(items);
				this.m_view.updatePaging();
				break;

			case oFF.FdController.IDENTIFIER_RELOAD:
				this.m_model.addItems(items, 0);
				this.m_view.publishMembersList(this.m_model.getItemsOnCurrentPage());
				this.m_view.updatePaging();
				this.checkNoResults(items);
				break;

			case oFF.FdController.IDENTIFIER_LOAD_ATTRIBUTES:
				this.m_view.publishPresentations();
				this.m_view.updatePaging();
				break;

			case oFF.FdController.IDENTIFIER_LOAD_ATTRIBUTES_AND_REFRESH:
				this.m_view.publishMembersList(this.m_model.getItemsOnCurrentPage());
				this.m_view.updatePaging();
				break;

			case oFF.FdController.IDENTIFIER_PRELOAD:
				this.m_model.addItems(items, startPage);
				this.m_view.updatePaging();
				break;

			case oFF.FdController.IDENTIFIER_PRELOAD_SELECTION:
				this.m_view.publishSelectedItemsList();
				break;

			case oFF.FdController.IDENTIFIER_SELECT_ALL:
				this.m_model.addItems(items, startPage);
				this.m_model.selectAll();
				this.m_view.publishSelectedItemsList();
				break;

			default:
		}
	}
};
oFF.FdController.prototype.fetchValueHelpFunctions = function()
{
	this.m_valueHelpExecutor.fetchValueHelpFunctions(this, oFF.XStringValue.create(oFF.FdController.IDENTIFIER_INITIAL_LOAD_FUNCTIONS));
};
oFF.FdController.prototype.fetchValueHelpData = function()
{
	var isHierarchicalValueHelp = this.m_valueHelpExecutor.isHierarchicalValueHelp();
	var isTreeViewDesktop = isHierarchicalValueHelp && !this.m_context.getDeviceInfo().isMobile();
	var presentationValues = oFF.FdPresentationUtils.flattenPresentations(isTreeViewDesktop ? this.m_model.getAdditionalPresentations() : this.m_model.getDefaultAdditionalPresentations());
	var preloadPages = isHierarchicalValueHelp ? -1 : this.m_configuration.getPreloadedPages();
	this.m_valueHelpExecutor.processValueHelp(0, preloadPages, presentationValues, this, oFF.XStringValue.create(oFF.FdController.IDENTIFIER_INITIAL_LOAD));
};
oFF.FdController.prototype.getAdditionalPresentations = function()
{
	if (!this.m_valueHelpExecutor.supportsAdditionalPresentations())
	{
		return oFF.XList.create();
	}
	return oFF.FdPresentationUtils.getAdditionalPresentationsByDim(this.m_valueHelpExecutor.getDimension(), this.m_context.getLocalization(), this.m_valueHelpExecutor.isHierarchicalValueHelp());
};
oFF.FdController.prototype.onInitialLoadFinished = function(items)
{
	var layoutType = oFF.FdLayoutType.getLayoutType(this.m_valueType.isValueHelp() && this.m_valueHelpExecutor.isHierarchicalValueHelp(), this.m_context.getDeviceInfo().isMobile());
	this.m_model.setLayoutType(layoutType);
	this.m_model.addItems(items, 0);
	this.createView(layoutType);
	if (this.m_valueType.isValueHelp())
	{
		this.m_valueHelpExecutor.syncSelectionListWithKnownItems(this.m_model.getSelectedItems(), items, null, this, oFF.XStringValue.create(oFF.FdController.IDENTIFIER_PRELOAD_SELECTION));
	}
	else
	{
		this.m_view.publishSelectedItemsList();
	}
	this.m_view.publishMembersList(this.m_model.getItemsOnCurrentPage());
	this.m_view.updatePaging();
	this.checkNoResults(items);
};
oFF.FdController.prototype.checkNoResults = function(items)
{
	if (!oFF.XCollectionUtils.hasElements(items))
	{
		var externalProvider = this.m_configuration.getExternalValueHelpProcess();
		var tag = oFF.notNull(externalProvider) ? externalProvider.getNoResultMessageTag() : oFF.FilterDialogI18n.I18N_FD_NO_RESULTS;
		this.m_view.showInfoMessage(this.m_context.getLocalization().getText(tag));
	}
};
oFF.FdController.prototype.createView = function(layoutType)
{
	if (oFF.isNull(this.m_view))
	{
		this.m_view = oFF.FdView.createView(this, this.m_model, this.m_context, layoutType);
		if (oFF.isNull(this.m_view))
		{
			throw oFF.XException.createIllegalArgumentException(oFF.XStringUtils.concatenate2("Unsupported layout type: ", layoutType.toString()));
		}
		var genesis = this.m_display.getGenesis();
		this.m_view.buildUi(this.m_display.getGenesis());
		this.m_view.setSelectionMode(this.m_configuration.getSelectionMode());
		if (this.m_functionControllers.hasElements())
		{
			var tabText = this.m_context.getLocalization().getText(oFF.FilterDialogI18n.I18N_FD_FVH_ABSOLUTE_VALUES);
			this.m_sideTab = oFF.OlapUiSideTab.create(genesis);
			this.m_sideTab.addTab(oFF.FdController.MAIN_TAB_NAME, tabText, this);
			var it = this.m_functionControllers.getIterator();
			while (it.hasNext())
			{
				var fController = it.next();
				this.m_sideTab.addTab(fController.getName(), fController.getDescription(), fController);
			}
			this.m_sideTab.buildUi(genesis);
		}
		else
		{
			genesis.setRoot(this.m_view.getLayoutRoot());
		}
		this.m_okButton.registerOnPress(this.m_view);
		this.m_okButton.setVisible(true);
		this.m_cancelButton.registerOnPress(this.m_view);
	}
};
oFF.FdController.prototype.search = function(searchPattern, searchPresentations, presentations, loadParentNodes, customIdentifier)
{
	if (this.m_model.isReadModeSwitchEnabled())
	{
		this.m_valueHelpExecutor.setRequestMasterData(this.m_model.isReadModeSwitchOn());
	}
	this.m_valueHelpExecutor.search(searchPattern, searchPresentations, presentations, loadParentNodes, this.m_view, customIdentifier);
};
oFF.FdController.prototype.getSearchInfoMessage = function(searchItems)
{
	if (oFF.XCollectionUtils.hasElements(searchItems))
	{
		if (searchItems.size() >= this.m_configuration.getSearchSize())
		{
			var pageSize = oFF.XInteger.convertToString(this.m_configuration.getSearchSize());
			return this.m_context.getLocalization().getTextWithPlaceholder(oFF.FilterDialogI18n.I18N_FD_MAX_RESULTS, pageSize);
		}
	}
	else
	{
		var externalProvider = this.m_configuration.getExternalValueHelpProcess();
		var tag = oFF.notNull(externalProvider) ? externalProvider.getNoResultMessageTag() : oFF.FilterDialogI18n.I18N_FD_NO_RESULTS;
		return this.m_context.getLocalization().getText(tag);
	}
	return null;
};
oFF.FdController.prototype.isReloadRequired = function(item, requiredPresentations)
{
	return oFF.isNull(item) || oFF.XCollectionUtils.hasElements(this.m_valueHelpExecutor.getMissingPresentations(oFF.XCollectionUtils.singletonList(item), requiredPresentations));
};
oFF.FdController.prototype.refreshList = function(presentations, refreshAttributesOnly, currentPageOnly)
{
	if (this.reloadDataRequired(presentations))
	{
		return;
	}
	var items = currentPageOnly ? this.m_model.getItemsOnCurrentPage() : this.m_model.getItems(0, this.m_model.getPage());
	var currentPage = this.m_model.getPage();
	if (oFF.XCollectionUtils.hasElements(items) && this.m_valueType.isValueHelp())
	{
		var missingPresentations = this.m_valueHelpExecutor.getMissingPresentations(items, presentations);
		if (oFF.XCollectionUtils.hasElements(missingPresentations))
		{
			var identifier = oFF.XStringValue.create(refreshAttributesOnly ? oFF.FdController.IDENTIFIER_LOAD_ATTRIBUTES : oFF.FdController.IDENTIFIER_LOAD_ATTRIBUTES_AND_REFRESH);
			this.m_valueHelpExecutor.loadMissingAttributes(this.m_model.getItems(0, -1), missingPresentations, this, identifier);
		}
		else
		{
			this.onProcessFinished(items, currentPage, oFF.XStringValue.create(refreshAttributesOnly ? oFF.FdController.IDENTIFIER_LOAD_ATTRIBUTES : oFF.FdController.IDENTIFIER_REFRESH));
		}
		this.m_valueHelpExecutor.preloadNextPages(this.getNextPageWithoutItemsLoaded(currentPage), presentations, this, oFF.XStringValue.create(oFF.FdController.IDENTIFIER_PRELOAD));
	}
	else
	{
		this.onProcessFinished(oFF.XList.create(), currentPage, oFF.XStringValue.create(oFF.FdController.IDENTIFIER_REFRESH));
	}
};
oFF.FdController.prototype.refreshTree = function(presentations, refreshAttributesOnly, parentNode)
{
	if (this.reloadDataRequired(presentations))
	{
		return;
	}
	var identifier = oFF.XStringValue.create(refreshAttributesOnly ? oFF.FdController.IDENTIFIER_LOAD_ATTRIBUTES : oFF.FdController.IDENTIFIER_REFRESH);
	var items = oFF.notNull(parentNode) ? parentNode.getChildren() : this.m_model.getItemsOnCurrentPage();
	if (oFF.XCollectionUtils.hasElements(items) && this.m_valueType.isValueHelp())
	{
		var missingPresentations = this.m_valueHelpExecutor.getMissingPresentations(items, presentations);
		if (oFF.XCollectionUtils.hasElements(missingPresentations))
		{
			this.m_valueHelpExecutor.loadMissingAttributes(items, missingPresentations, this, identifier);
			return;
		}
	}
	this.onProcessFinished(oFF.notNull(items) ? items : oFF.XList.create(), 0, identifier);
};
oFF.FdController.prototype.reloadDataRequired = function(presentations)
{
	if (this.m_model.isInitial() && this.m_valueType.isValueHelp())
	{
		if (this.m_model.isReadModeSwitchEnabled())
		{
			this.m_valueHelpExecutor.setRequestMasterData(this.m_model.isReadModeSwitchOn());
		}
		var pageCount = this.m_valueHelpExecutor.isHierarchicalValueHelp() ? -1 : this.m_configuration.getPreloadedPages();
		this.m_valueHelpExecutor.processValueHelp(0, pageCount, presentations, this, oFF.XStringValue.create(oFF.FdController.IDENTIFIER_RELOAD));
		return true;
	}
	return false;
};
oFF.FdController.prototype.getNextPageWithoutItemsLoaded = function(currentPage)
{
	for (var i = 1; i <= oFF.FdConfiguration.MIN_PRELOAD_PAGE_COUNT; i++)
	{
		if (!oFF.XCollectionUtils.hasElements(this.m_model.getItemsByPage(currentPage + i)))
		{
			return currentPage + i;
		}
	}
	return -1;
};
oFF.FdController.prototype.onPress = function(event)
{
	var controlName = event.getControl().getName();
	switch (controlName)
	{
		case oFF.FdController.OK_BUTTON:
			if (oFF.notNull(this.m_sideTab) && !oFF.XString.isEqual(this.m_sideTab.getActiveTabName(), oFF.FdController.MAIN_TAB_NAME))
			{
				this.m_functionControllers.getByKey(this.m_sideTab.getActiveTabName()).onOkPress();
			}
			else
			{
				this.confirmSelection();
			}
			break;

		case oFF.FdController.CANCEL_BUTTON:
			this.cancelSelection();
			break;

		default:
	}
};
