oFF.FdController.prototype.fetchChildren = function(node, offset, amount, presentations, listener, customIdentifier)
{
	if (this.m_valueType.isValueHelp())
	{
		this.m_valueHelpExecutor.fetchChildren(node, offset, amount, presentations, listener, customIdentifier);
	}
};
oFF.FdController.prototype.loadAndSelectAllMembers = function(presentations)
{
	if (this.m_valueType.isValueHelp())
	{
		var currentMaxPage = this.m_model.getPageCount();
		var itemsOnLastPage = this.m_model.getItemsByPage(currentMaxPage - 1);
		if (oFF.notNull(itemsOnLastPage) && itemsOnLastPage.size() >= this.m_configuration.getPageSize())
		{
			this.m_valueHelpExecutor.processValueHelp(currentMaxPage, -1, presentations, this, oFF.XStringValue.create(oFF.FdController.IDENTIFIER_SELECT_ALL));
		}
		else
		{
			this.onProcessFinished(oFF.XList.create(), 0, oFF.XStringValue.create(oFF.FdController.IDENTIFIER_SELECT_ALL));
		}
	}
};
oFF.FdController.prototype.onError = function(messages, customIdentifier)
{
	if (oFF.XString.isEqual(customIdentifier.toString(), oFF.FdController.IDENTIFIER_INITIAL_LOAD) && this.m_valueType.isValueHelp() && this.m_valueHelpExecutor.isSystemTypeHana() && !this.m_valueHelpExecutor.isRequestMasterData() && this.m_model.isReadModeSwitchEnabled())
	{
		this.m_model.setReadModeSwitchOn(true);
		this.m_valueHelpExecutor.setRequestMasterData(true);
		this.fetchValueHelpData();
		return;
	}
	var messageCenter = this.m_context.getMessageCenter();
	if (this.m_valueType.isValueHelp() && this.m_valueHelpExecutor.isMissingValueForMandatoryVariableError(messageCenter.getInaErrorCode(messages)))
	{
		messageCenter.postMesssage(oFF.UiMessageType.WARNING, this.m_context.getLocalization().getText(oFF.FilterDialogI18n.I18N_FD_ERR_NO_VALUES_FOR_MANDATORY_VARIABLES), oFF.FdController.COMPONENT_NAME);
	}
	else
	{
		var msg = messageCenter.getInaErrorMessage(messages, this.m_context.getLocalization().getText(oFF.FilterDialogI18n.I18N_FD_ERR_VH_SERVER_ERROR));
		messageCenter.postMesssage(oFF.UiMessageType.ERROR, msg, oFF.FdController.COMPONENT_NAME);
	}
	if (this.m_display.getGenesis().getRoot().getUiType() === oFF.UiType.ACTIVITY_INDICATOR)
	{
		this.cancelSelection();
	}
	else if (oFF.notNull(this.m_view))
	{
		this.m_view.onError(messages, customIdentifier);
	}
};
