	if (genesis.getUiManager().getDeviceInfo().isSmartphone())
	{
		additionalPresentations.registerOnSelectionFinish(this);
	}
	var dropdownItems = this.createDropdownItems(additionalPresentations, this.m_model.getAdditionalPresentations());
	additionalPresentations.addAllItems(dropdownItems);
