oFF.VdVariantPopupBase.prototype.setupPopupBase = function(manager, processor)
{
	this.m_manager = manager;
	this.m_processor = processor;
	this.m_i18n = this.m_manager.getUiContext().getLocalization();
	this.updateVariantList();
};
oFF.VdVariantPopupBase.prototype.releaseObject = function()
{
	this.m_manager = null;
	this.m_processor = null;
	this.m_i18n = null;
	this.m_variants = oFF.XObjectExt.release(this.m_variants);
	oFF.UiFormPopup.prototype.releaseObject.call( this );
};
oFF.VdVariantPopupBase.prototype.configurePopup = function(dialog)
{
	oFF.UiFormPopup.prototype.configurePopup.call( this , dialog);
	dialog.setWidth(oFF.UiCssLength.create("720px"));
	this.setSubmitButtonIcon(null);
	this.setSubmitButtonText(this.m_i18n.getText(oFF.VariantPopupI18n.I18N_VARIANT_POPUP_SAVE));
	this.setCancelButtonIcon(null);
	this.setCancelButtonText(this.m_i18n.getText(oFF.VariantPopupI18n.I18N_VARIANT_POPUP_CANCEL));
};
oFF.VdVariantPopupBase.prototype.updateVariantList = function()
{
	this.m_variants = oFF.XStream.of(this.m_processor.getVariableVariants()).collect(oFF.XStreamCollector.toListOfNameObject());
};
oFF.VdVariantPopupBase.prototype.addVariantSectionBase = function(sectionName, name, text, scope, showTitle)
{
	var nameTitle = this.m_i18n.getText(oFF.VariantPopupI18n.I18N_VARIANT_TECHNICAL_NAME);
	var textTitle = this.m_i18n.getText(oFF.VariantPopupI18n.I18N_VARIANT_NAME);
	var typeTitle = this.m_i18n.getText(oFF.VariantPopupI18n.I18N_VARIANT_TYPE);
	var variantSection = this.addFormSection(sectionName, null, true);
	var textItem = variantSection.addInput(oFF.VdVariantPopupBase.PROPERY_TEXT, text, textTitle, true, "", null);
	textItem.setShowLabel(showTitle);
	textItem.setFlex("2 0 auto");
	textItem.setCustomRequiredText(this.m_i18n.getText(oFF.VariantPopupI18n.I18N_VARIANT_NAME_REQUIRED));
	var scopeItem = variantSection.addDropdown(oFF.VdVariantPopupBase.PROPERY_SCOPE, scope.getName(), typeTitle, false, this.getVariantScopes(), false);
	scopeItem.setShowLabel(showTitle);
	scopeItem.setFlex("1 0 auto");
	var nameItem = variantSection.addInput(oFF.VdVariantPopupBase.PROPERY_NAME, name, nameTitle, true, "", null);
	nameItem.setShowLabel(showTitle);
	nameItem.setFlex("2 0 auto");
	nameItem.setCustomRequiredText(this.m_i18n.getText(oFF.VariantPopupI18n.I18N_VARIANT_TECHNICAL_NAME_REQUIRED));
	nameItem.setEditable(false);
	this.updateSection(variantSection, name, scope);
	scopeItem.registerOnFormItemEvents(oFF.UiFormItemLambdaListener.createLambda( function(item){
		this.updateSection(variantSection, null, oFF.Scope.lookupByName(scopeItem.getValue().getStringRepresentation()));
	}.bind(this)));
	return variantSection;
};
oFF.VdVariantPopupBase.prototype.getVariantScopes = function()
{
	var i18n = this.m_manager.getUiContext().getLocalization();
	var tmpTypeMap = oFF.XHashMapOfStringByString.create();
	tmpTypeMap.put(oFF.Scope.USER.getName(), i18n.getText(oFF.VariantPopupI18n.I18N_VARIANT_PERSONAL));
	tmpTypeMap.put(oFF.Scope.GLOBAL.getName(), i18n.getText(oFF.VariantPopupI18n.I18N_VARIANT_GLOBAL));
	return tmpTypeMap;
};
oFF.VdVariantPopupBase.prototype.updateSection = function(section, variantName, scope)
{
	var personal = scope === oFF.Scope.USER;
	var name = personal ? this.m_i18n.getText(oFF.VariantPopupI18n.I18N_VARIANT_GENERATED_ID) : variantName;
	var nameItem = section.getFormItemByKey(oFF.VdVariantPopupBase.PROPERY_NAME);
	nameItem.setEditable(!personal);
	nameItem.setValue(oFF.XStringValue.create(name));
};
oFF.VdVariantPopupBase.prototype.validateTechnicalName = function(formItem, ignoreVariant)
{
	var userInput = formItem.getValue().getStringRepresentation();
	if (oFF.isNull(ignoreVariant) || !oFF.XString.isEqual(oFF.XString.toLowerCase(userInput), oFF.XString.toLowerCase(ignoreVariant.getName())))
	{
		var duplicate = oFF.XStream.of(this.m_variants).anyMatch( function(v2){
			return oFF.XString.isEqual(oFF.XString.toLowerCase(v2.getName()), oFF.XString.toLowerCase(userInput));
		}.bind(this));
		if (duplicate)
		{
			var i18n = this.m_manager.getUiContext().getLocalization();
			formItem.setInvalid(i18n.getText(oFF.VariantPopupI18n.I18N_VARIANT_TECHNICAL_NAME_UNIQUE));
			return false;
		}
	}
	formItem.setValid();
	return true;
};
oFF.VdVariantPopupBase.prototype.showGeneralErrorMessage = function(overallResult, defaultMsg)
{
	var uiContext = this.m_manager.getUiContext();
	var messageCenter = uiContext.getMessageCenter();
	var msg = messageCenter.getInaErrorMessage(overallResult, defaultMsg);
	messageCenter.postMesssage(oFF.UiMessageType.ERROR, msg, oFF.VdVariantPopupBase.COMPONENT_NAME);
};

