oFF.VdVariantManagerDeleteAction.prototype._ff_c = "VdVariantManagerDeleteAction";

oFF.VdVariantManagerDeleteAction.createAndRunDelete = function(variantsToDelete, syncType, processor, consumer)
{
	var obj = new oFF.VdVariantManagerDeleteAction();
	obj.m_variantsToDelete = variantsToDelete;
	obj.m_resultPerVariant = oFF.XHashMapByString.create();
	obj.m_consumer = consumer;
	obj.setupActionAndRun(syncType, obj, null, processor);
	return obj;
};
oFF.VdVariantManagerDeleteAction.prototype.m_variantsToDelete = null;
oFF.VdVariantManagerDeleteAction.prototype.m_resultPerVariant = null;
oFF.VdVariantManagerDeleteAction.prototype.m_consumer = null;
oFF.VdVariantManagerDeleteAction.prototype.m_processing = false;
oFF.VdVariantManagerDeleteAction.prototype.m_callbackCount = 0;
oFF.VdVariantManagerDeleteAction.prototype.releaseObject = function()
{
	this.m_variantsToDelete = null;
	this.m_resultPerVariant = null;
	this.m_consumer = null;
	oFF.SyncAction.prototype.releaseObject.call( this );
};
oFF.VdVariantManagerDeleteAction.prototype.processSynchronization = function(syncType)
{
	if (!oFF.XCollectionUtils.hasElements(this.m_variantsToDelete))
	{
		return false;
	}
	var processor = this.getActionContext();
	this.m_processing = true;
	for (var i = 0; i < this.m_variantsToDelete.size(); i++)
	{
		var variant = this.m_variantsToDelete.get(i);
		processor.deleteVariableVariant(variant, syncType, this, variant);
	}
	this.m_processing = false;
	this.checkIfDone();
	return true;
};
oFF.VdVariantManagerDeleteAction.prototype.onVariableProcessorExecuted = function(extResult, result, customIdentifier)
{
	this.m_callbackCount++;
	var variant = customIdentifier;
	if (extResult.hasErrors())
	{
		this.addAllMessages(extResult);
		this.m_resultPerVariant.put(variant.getName(), extResult);
	}
	this.checkIfDone();
};
oFF.VdVariantManagerDeleteAction.prototype.checkIfDone = function()
{
	if (!this.m_processing && this.m_callbackCount >= this.m_variantsToDelete.size())
	{
		this.endSync();
	}
};
oFF.VdVariantManagerDeleteAction.prototype.callListener = function(extResult, listener, data, customIdentifier)
{
	this.m_consumer(this, this.m_resultPerVariant);
};

